    render() {
        return (
            <div class="center Glass-plate main">
                <Title title="SociaLod" align="bold h1" />
                <div class="right-bottom">
                    <Link><Icon src='https://img.icons8.com/ios-filled/50/ffffff/circled-chevron-right.png' /></Link>
                    <Link><Icon src='https://img.icons8.com/ios-filled/50/ffffff/circled-chevron-right.png' /></Link>
                    <Link><Icon src='https://img.icons8.com/ios-filled/50/ffffff/circled-chevron-right.png' /></Link>
                </div>
            </div>
        );
    }
}
